import React, { useState } from 'react';
import {Routes, Route, useNavigate, renderMatches} from 'react-router-dom';
import gcmateLogo from './img/GCMateIcon.png';
import MouseIcon from './img/CompMouse.png';
import './App.css';


const App = () => {
  const [rin, setRIN] = useState(null);

  function getRIN(val) {
    setRIN(val.target.value)
  }

  return (
    <div className="App" style={{
      position: 'absolute',
      backgroundImage: 'url('+gcmateLogo+')',
      backgroundSize: "cover",
      height: "721px",
      width: "1535px" 
    }}>
      
      <div className="Title"><h1> Welcome to GCMate! </h1></div> 

      <div className="Prompt"> <h2>Please enter your RIN</h2></div>
      <div className="Input"> <input type="text" onChange={getRIN}/> </div>
      <div className="LearnIcon" ><img src={MouseIcon} width="40" alt="aa"/></div>
      <div className="LearnMoreText"> <h2>LEARN MORE</h2> </div>
    </div>
  );
};



export default App;
